import React from 'react'

export default function Footer () {
    return (
    <div> 
        <div class="container flex space-around">
            <a href="#"><i className="fab icon fa-twitter"></i></a>
            <a href="#"><i class="fab icon fa-facebook-square"></i></a>
            <a href="#"><i class="fab icon fa-instagram-square"></i></a>
            <a href="#"><i class="fab icon fa-github-square"></i></a>
        </div>
    </div>
    )
}
